const Suggestion = () => {
    const [isOpen, setIsOpen] = useState(false)

    const toggle = () => {
        setIsOpen(!isOpen)
    }

    return (
        <>
            
            <h1>SUGGESTION PAGE </h1>
            
        </>
    );
};

export default Suggestion;
